// Validate input parameters
const input = $input.first().json;

if (!input.query || input.query.trim() === '') {
  throw new Error('Search query is required');
}

if (!input.regionCode || input.regionCode.trim() === '') {
  throw new Error('Region code is required');
}

if (input.pageSize < 1 || input.pageSize > 1000) {
  throw new Error('Page size must be between 1 and 1000');
}

console.log('‚úÖ Input validation passed');
console.log('Query: ' + input.query);
console.log('Region: ' + input.regionCode);
console.log('Industry: ' + (input.industryCode || 'None'));
console.log('Page size: ' + input.pageSize);

return [{ json: input }];

// Process and normalize search results
const response = $input.first().json;

// Implisense /search returns a SearchResult object.
// In deinem Beispiel ist das Ergebnis zus√§tzlich in einem Array gekapselt.
// Wir holen uns robust den eigentlichen Body:
let body;

if (Array.isArray(response)) {
  // Fall: HTTP Node liefert direkt das Array wie im Beispiel
  body = response[0] || {};
} else if (response && typeof response === 'object' && response.body) {
  // Fall: Response ist { body: SearchResult, ... }
  body = response.body;
} else {
  // Fall: Response ist direkt das SearchResult-Objekt
  body = response || {};
}

const companies = body.companies || body.results || [];
// Implisense SearchResult hat das Feld "size" = total number of matches
// https://docs.implisense.com/api/ :contentReference[oaicite:0]{index=0}
const total = (typeof body.size === 'number')
  ? body.size
  : (body.total || companies.length);

console.log('‚úÖ Search API Success: ' + companies.length + ' companies found (total: ' + total + ')');

if (companies.length === 0) {
  console.warn('‚ö†Ô∏è No companies found for the given criteria');
  return [{
    json: {
      workflow_run_id: $('Prepare Search Input').first().json.workflow_run_id,
      warning: 'No companies found',
      query: $('Prepare Search Input').first().json.query,
      regionCode: $('Prepare Search Input').first().json.regionCode,
      timestamp: new Date().toISOString(),
      total: total,
    }
  }];
}

// Normalize and enrich company data
const normalized = companies.map(function(company, idx) {
  // Calculate relevance score based on multiple factors
  let relevanceScore = company.score || 0;

  // Boost score if company is active
  if (company.active === true) {
    relevanceScore += 10;
  }

  // Boost score if website exists
  if (company.url && company.url.trim() !== '') {
    relevanceScore += 5;
  }

  // Boost score if full address available
  if (company.street && company.zip && company.city) {
    relevanceScore += 3;
  }

  return {
    idx: idx,
    implisenseId: company.id,
    name: company.name || '',
    street: company.street || '',
    zip: company.zip || '',
    city: company.city || '',
    url: company.url || '',
    active: company.active !== false,
    rawScore: company.score || 0,
    relevanceScore: relevanceScore,
    targetRegion: $('Prepare Search Input').first().json.regionCode,
    industryCode: $('Prepare Search Input').first().json.industryCode,
    source: 'search_api',
    workflow_run_id: $('Prepare Search Input').first().json.workflow_run_id,
    processed_at: new Date().toISOString(),
    // Optional: total result size aus Implisense-Search (f√ºr sp√§tere Steps hilfreich)
    search_total: total,
  };
});

console.log('üìä Normalized ' + normalized.length + ' companies with relevance scoring');

return normalized.map(function(c) { return { json: c }; });

// Sort by relevance score (descending)
const items = $input.all();

const sorted = items.sort(function(a, b) {
  const scoreA = a.json.relevanceScore || 0;
  const scoreB = b.json.relevanceScore || 0;
  return scoreB - scoreA;
});

console.log('üîÑ Sorted ' + sorted.length + ' companies by relevance score');
if (sorted.length > 0) {
  console.log('   Top company: ' + sorted[0].json.name + ' (score: ' + sorted[0].json.relevanceScore + ')');
}

return sorted;

// Merge and prepare final output
const items = $input.all();

console.log('‚úÖ Total qualified leads: ' + items.length);

const highQuality = items.filter(function(item) {
  return item.json.leadQuality === 'high';
}).length;

const mediumQuality = items.filter(function(item) {
  return item.json.leadQuality === 'medium';
}).length;

console.log('   High quality: ' + highQuality);
console.log('   Medium quality: ' + mediumQuality);

return items;

